import Formulario from "./Formulario";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {

  return (
    <div>
      <BrowserRouter>
        <Routes>

          <Route path="/" exact element={<Menu/>} />
          <Route path="/cadastroMotorista" element={<Formulario/>} />
          <Route path="*" element={<Pagina404/>} />

        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
